import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

<div id="root"></div>

    function tick() {
        const element = (
            <div>
                <h1>Hello, Andre!</h1>
                <h2>It is {new Date().toLocaleTimeString()}</h2>
            </div>
        );
        ReactDOM.render(element, document.getElementById('root'));
    }
    setInterval(tick, 1000);
